INSERT INTO `llamada` (`id`, `titulo`, `descripcion`, `fecha`, `hora`, `idProspecto`, `idAgente`, `fechaCreacion`, `finalizada`, `detalle`, `color`, `fechaInicial`, `fechaFinal`) VALUES
(1, 'Llamada', '', '2020-08-31', '10:00:00', 111, 5, '2020-08-28 14:51:45', 0, '', NULL, NULL, NULL),
(2, 'Llamada', '', '2020-10-05', '11:00:00', 217, 12, '2020-10-05 17:56:27', 0, '', NULL, NULL, NULL),
(3, 'Llamada', 'Llamada agendada a partir de la llamada del día lunes', '2020-10-07', '11:00:00', 217, 12, '2020-10-05 17:57:29', 0, '', NULL, NULL, NULL),
(4, 'Se envió WhatsApp', 'Se le llamó y no contestó, se le envío un WhatsApp, solicitándole una cita. Quedo pendiente a su respuesta.', '2020-10-05', '09:10:00', 168, 12, '2020-10-05 18:29:03', 0, '', NULL, NULL, NULL),
(5, 'Hablar con personal de mantenimiento', 'Se habló con personal de mantenimiento, pidieron que me comunicara con comprador para preguntarle que requiero para darles el servicio.', '2020-10-05', '08:50:00', 232, 12, '2020-10-05 18:32:59', 0, '', NULL, NULL, NULL),
(6, 'Posible Cliente', 'Me pidió el Lic. Eduardo que le llamé por la tarde, para decirme que necesito hacer para que vean las características de nuestra pintura y tomarnos como opción para pintar las piezas que fabrican.', '2020-10-05', '09:06:00', 207, 12, '2020-10-05 18:39:11', 0, '', NULL, NULL, NULL),
(7, 'Posible Cliente', 'Llamarle para consertar cita para conocer que requieren en pintura y ofrecerle nuestra opción.', '2020-10-05', '17:00:00', 207, 12, '2020-10-05 18:41:33', 0, '', NULL, NULL, NULL),
(8, 'Seguimiento a cotización', 'No encontré a la Lic. Cinthia le dejé recado preguntando si revisó mi cotización y tiene algún comentario o respuesta', '2020-10-05', '09:19:00', 233, 12, '2020-10-05 18:44:36', 0, '', NULL, NULL, NULL),
(9, 'Posible cita', 'Hablé con lic. Sandra me comentó que mañana martes 6 de OCT. Me marca para darme una cita.', '2020-10-05', '23:09:00', 231, 12, '2020-10-05 18:49:41', 0, '', NULL, NULL, NULL),
(10, 'Preguntar si ya revisó Presentación', 'Le llamé a la ING. Selene Bautista para preguntarle si ya había revisado la presentación que le envié, me comentó que todavía, quedó de revisarla y mandarme sus comentarios.', '2020-10-05', '11:32:00', 170, 12, '2020-10-05 18:59:25', 0, '', NULL, NULL, NULL),
(11, 'Llamada seguimiento a presentación', 'Le llamé a la lic. Fernanda Montiel, para preguntarle si revisó mi presentación, me comentó que por el momento no requiere de alguno de nuestros productos pero que nos va a tener en cartera para cuando requiera algo.', '2020-10-05', '22:08:00', 245, 12, '2020-10-05 19:09:49', 0, '', NULL, NULL, NULL),
(12, 'Seguimiento a la presentación que envié', 'Busque al c.p. Luis Masieu, estaba en junta que de devolverle la llamada.', '2020-10-05', '10:45:00', 226, 12, '2020-10-05 19:13:56', 0, '', NULL, NULL, NULL),
(13, 'Seguimiento', 'Le llamé al comprador, me comentó que todavía no tiene las especificaciones de la pintura que le llamé mañana antes del medio día y ya me tiene una respuesta', '2020-10-05', '16:55:00', 207, 12, '2020-10-05 21:56:30', 0, '', NULL, NULL, NULL),
(14, 'Hablar con Antonio Jiménez Compras', 'Le llamé me mandó a buzón.', '2020-10-05', '17:04:00', 232, 12, '2020-10-05 22:04:49', 0, '', NULL, NULL, NULL),
(15, 'Seguimiento a Presentación', 'Le llamé a la lic. Joselyn de compras, requiere de un proveedor que de mantenimiento con pintura epóxica.', '2020-10-05', '17:10:00', 188, 12, '2020-10-05 22:11:36', 0, '', NULL, NULL, NULL),
(16, 'Llamada de presentación', 'Intente llamarle a la lic. Susana de compras su casillero de llamadas está lleno no pude comunicarme', '2020-10-06', '09:11:00', 174, 12, '2020-10-06 14:12:31', 0, '', NULL, NULL, NULL),
(17, 'Llamada para ofrecer productos', 'Hablé con Ricardo Pastrana me pidió le enviará mis datos y cuando requiera de algo me llaman, ya nos conoce.', '2020-10-06', '09:23:00', 169, 12, '2020-10-06 14:24:47', 0, '', NULL, NULL, NULL),
(18, 'Llamada de presentación', 'Me presente con la lic. Ahora trabaja en SeSe Logística, está en Home Office me pidió le envié mi presentación y tan pronto requiera de nuestros productos se pone en contacto con nosotros.', '2020-10-06', '09:37:00', 194, 12, '2020-10-06 14:40:35', 0, '', NULL, NULL, NULL),
(19, 'Llamada', 'Llame me pasaron a compras pero noe contestaron.', '2020-10-06', '09:52:00', 167, 12, '2020-10-06 14:53:08', 0, '', NULL, NULL, NULL),
(20, 'Llamada si requieren producto', 'Me comentó c.p. Omar que por el momento no requiere de nuestros productos que tiene mis datos y cuando requiera de algo se pone en contacto con nosotros', '2020-10-06', '10:05:00', 192, 12, '2020-10-06 15:06:52', 0, '', NULL, NULL, NULL),
(21, 'Llamada presentación', 'Me pidieron dejar un correo para que a través de ese correo me den cita para hablar con el comprador', '2020-10-06', '10:46:00', 230, 12, '2020-10-06 15:47:48', 0, '', NULL, NULL, NULL),
(22, 'Llamada presentación', 'Me pidieron dejar un correo para que a través de ese correo me den cita para hablar con el comprador', '2020-10-06', '10:46:00', 230, 12, '2020-10-06 15:48:16', 0, '', NULL, NULL, NULL),
(23, 'Llamada a compras', 'No pude contactar a personal de compras están todavía en Home Office.', '2020-10-06', '10:51:00', 229, 12, '2020-10-06 15:51:59', 0, '', NULL, NULL, NULL),
(24, 'Se envió correo', 'Se le llamó al comprador pero no sé encontró está en Home Office, se le envío un correo para preguntarle si nuestros datos como proveedor son correctos, fue un requisito que me solicitó la ING. De mantenimiento para poder hablar con ella.', '2020-10-06', '11:44:00', 232, 12, '2020-10-06 16:47:01', 0, '', NULL, NULL, NULL),
(25, 'Llame para presentarme', 'Me presente con la c.p. Elena y me pidió que le llamara el lunes de la próxima semana para agendar una cita y ver unas muestras.', '2020-10-06', '11:58:00', 210, 12, '2020-10-06 17:00:10', 0, '', NULL, NULL, NULL),
(26, 'Llamada', 'Llame a la empresa noe contestaron en el teléfono que tengo. Sigo intentando contactarlos, busco otros teléfonos en internet.', '2020-10-06', '12:29:00', 172, 12, '2020-10-06 17:31:20', 0, '', NULL, NULL, NULL),
(27, 'Llamada', 'Se le llamó al lic. Abonado para saber cuándo va a pagar quedó de devolver la llamada informando fecha de pago.', '2020-10-06', '16:38:00', 246, 12, '2020-10-06 21:38:58', 0, '', NULL, NULL, NULL),
(28, 'Llamada', 'Le llamé para comentarle que no trabajamos la pintura en polvo, me comentó que su cliente le pide ese requerimiento. Quedamos que si su cliente cambia de opinión me vuelve a llamar', '2020-10-06', '16:55:00', 180, 12, '2020-10-06 21:56:48', 0, '', NULL, NULL, NULL),
(29, 'Llamada', 'Llame a la ING Leticia Ocampo de mantenimiento, me comenta que ella no ve estos productos me pidió le envía un WhatsApp para que me indique con quién verlo.', '2020-10-07', '09:30:00', 187, 12, '2020-10-07 15:17:04', 0, '', NULL, NULL, NULL),
(30, 'Llamada', 'Hablé con la ING. Karla solicita una cubeta de esmalte rojo verbellon le urge', '2020-10-07', '10:00:00', 247, 12, '2020-10-07 15:19:34', 0, '', NULL, NULL, NULL),
(31, 'Llamada', 'Busque a la lic. Karina Cosme, no la encontré esta en Home Office, pero me comentaron que va los jueves quedé de llamarle', '2020-10-07', '10:31:00', 228, 12, '2020-10-07 15:32:38', 0, '', NULL, NULL, NULL),
(32, 'Llamada', 'Se realizó llamada a Paola Sanchez', '2020-10-07', '10:38:00', 133, 7, '2020-10-07 15:38:28', 1, 'Ya se realizó llamada y estamos pendientes a sus peticiones', NULL, NULL, NULL),
(33, 'Llamada', '', '2020-10-07', '10:45:00', 120, 7, '2020-10-07 15:39:12', 1, 'Mandara cotización', NULL, NULL, NULL),
(34, 'Llamada', 'Hablé con el lic. Daniel Galván y me comentó que trabajan con Berel, que me va a pasar los datos de la persona de mantenimiento para poder hacer algunas pruebas y nos puedan ver cómo otra opción más.', '2020-10-07', '10:44:00', 217, 12, '2020-10-07 15:46:28', 0, '', NULL, NULL, NULL),
